import { Wrapper, CopySection } from "../blocks/layout";
import Logo from "../blocks/logo";
import { H1 } from "../blocks/typograhy";

export default () => {
  return (
    <Wrapper>
      <Logo />
      <CopySection>
        <H1>Hello, my name is Georgemaine Lourens.</H1>
      </CopySection>
    </Wrapper>
  );
};
